import React from 'react'
const homeLanding = () => {
    return (
        <div style={{
            position: 'absolute', left: '50%', top: '50%',
            transform: 'translate(-50%, -50%)',
            textAlign: 'center'
        }}
            className='landing' >
            <h3>North America's Top Ranking</h3>
            <h1>Digital Marketing Agency</h1>
        </div>
    )
}

export default homeLanding
